var að eignast 85 módel af suzuki fox. bæði augablöðinn að aftan brotinn hjá mér og einhverjum hefur þótt það sniðugt að mauksjóða þá öll fjaðurblöðinn saman, 
vantar 50mm breið fjaðrablöð úr léttum bíl.

getiði bent mér á hvernig bílar komu með 50mm breiðum fjöðrum veit að willys kom með þeim
